import React from "react";
import {useParams} from "react-router-dom";
import ContactBar from "./Components/ContactBar";

var CaseData = require('./Components/Data Modules/CaseData'); //data set
// CaseData[i].URLquery
//need to write a function that will search through the data to find the object with the corresponding data
//find the correct project object and then use JSX to display the content
//on the page



function CaseStudy() {
  let {project} = useParams();
  return (
    <div className="caseStudy">
      <div className="returnHomeLink">Return to Homepage</div>
      <div className="caseNavBar">Navigation between case studies goes here </div>
      <DisplayCaseStudy />
      This is the case study page for {project}
    </div>
  );
}

function DisplayCaseStudy (){
  let {project} = useParams();
  const found = CaseData.find(element => element.URLquery === project);
  return <div className="CaseStudy__detail"><div className="caseName">{found.projName}</div>
  <div className="caseDescription">{found.bodyCopy}</div></div>
}

export default CaseStudy;
